package com.example.userschool.model;public class StudentFound {    private int studentID;    private int isFound;    public StudentFound(int studentID, int isFound) {        this.studentID = studentID;        this.isFound = isFound;    }    public int getStudentID() {        return studentID;    }    public void setStudentID(int studentID) {        this.studentID = studentID;    }    public int isFound() {        return isFound;    }    public void setFound(int found) {        isFound = found;    }}